import React from "react";
import { Col } from "react-bootstrap";

const ColGroup = (props) => (
  <Col lg={3}>
    <h5>{props.title}</h5>
    <p2><ul className="no-bullet">{props.children}</ul></p2>
  </Col>
);

export default ColGroup;
